import "./App.css";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import React, {useState} from 'react'




// importing components 
import { IndexComponent } from "./Components/IndexComponent";
import Navbar from "./Components/Navbar";

// Importing Pages 
import ProjectPage from "./pages/ProjectPage";

// Importing databases file 
import ProjectsDatabase from "./Components/ProjectsDatabase";



function App() {
  const [selectedproject, setselectedproject] = useState(null)

  function PortfolioPage (id){
    setselectedproject(id)
  }


  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element= {<IndexComponent ProjectsDatabase={ProjectsDatabase} PortfolioPage={PortfolioPage} />} /> 
        <Route path="/project" element={<ProjectPage selectedproject={selectedproject} ProjectsDatabase={ProjectsDatabase} />}  />
        {/* Add more routes for other pages */}
      </Routes>
    </BrowserRouter>

    // <>
    //   <Navbar/>
    //   <IndexComponent ProjectsDatabase={ProjectsDatabase} PortfolioPage={PortfolioPage} />
    // </>
  );
}

export default App;
